    const [r,reflash] = useState(0);
    return new Proxy(state,{
        set(target,key,value){
            state[key] = value;
            reflash(r + 1);
            return true;
        }
    })
}
const stateModel = yi({
    count : 0
})

function App() {
    return (
    <div>
      {stateModel.count}
    </div>
    );
}


export default App;
